  false,\n\t\"url\": null,\n\t\"notes\": \"NODC accession 0089633 includes physical
  and underway data collected aboard the ROGER REVELLE during cruise RR1002 in the
  South Pacific Ocean and Tasman Sea from 2010-01-26 to 2010-02-17. These data include
  CURRENT SPEED - EAST/WEST COMPONENT (U) and CURRENT SPEED - NORTH/SOUTH COMPONENT
  (V). The instruments used to collect these data include ADCP and GPS. These data
  were collected by Bradford Hager of MASSACHUSETTS INSTITUTE OF TECHNOLOGY and SCRIPPS
  INSTITUTION OF OCEANOGRAPHY as part of Constraining Mantle Rheology, Mantle Flow,
  and Crust/Mantle Coupling Beneath New Zealand. The Lamont-Doherty Earth Observatory
  (LDEO) submitted these data to NODC as part of the NSF sponsored Rolling Deck to
  Repository (R2R) program. The ADCP data represent the raw and automated processed
  data set. Post processed quality assessed data are not available in this accession.\",\n\t\"owner_org\":
